import React from 'react';
import styled from 'styled-components';

const ChatWindow: React.FC = () => {
    return (
        <>
            <Screen />
            <SenderBox>
                <Input />
                <SendBtn>
                    보내기
                </SendBtn>
            </SenderBox>
        </>
    );
};

export default ChatWindow;

const Screen = styled.div`
    position: absolute;
    top: 14px;
    width: 50%;
    height: 640px;
    background-color: ${({ theme }) => theme.colors.white20};
    border-radius: 30px;
    border: 1px solid ${({ theme }) => theme.colors.white};
`;

const SenderBox = styled.div`
    position: absolute;
    bottom: 14px;
    width: 50%;
    height: 100px;
    display: flex;
    justify-content: space-between;
    align-items: center;
    width: 50%;
`;

const Input = styled.input`
    all: unset;
    width: 90%;
    height: 90px;
    padding-left: 30px;
    font-size: 30px;
    border: 1px solid ${({ theme }) => theme.colors.white};
    border-radius: 30px;
`;

const SendBtn = styled.button`
    all: unset;
    width: 9%;
    height: 90px;
    text-align: center;
    border: 1px solid ${({ theme }) => theme.colors.white};
    border-radius: 30px;
`;
